import React from 'react';
import BuySellForm from '../components/BuySellForm';

const BuySellPage = () => {
  const userId = 1; // TODO: Replace with dynamic user later

  return (
    <div>
      <h1>Buy / Sell</h1>
      <BuySellForm userId={userId} />
    </div>
  );
};
